// import { useEffect } from 'react';
import { Link } from "react-router-dom";
import { Box, Container, Grid, Card, Typography } from "@mui/material";
import { DashboardLayout } from "./Dashboard/dashboard-layout";
import { MachineList } from "./machinelist/index.js";
import React, { useState, useEffect } from "react";
// import { MachineInfoPage } from "./machinelist/machineinfo/MachineinfoPage.js";
import { Route, Routes } from "react-router-dom";
import NotFound from "../404.js";
// import * as React from "react";
import CssBaseline from "@mui/material/CssBaseline";

import Toolbar from "@mui/material/Toolbar";
import List from "@mui/material/List";
import Divider from "@mui/material/Divider";
import IconButton from "@mui/material/IconButton";

import ChevronLeftIcon from "@mui/icons-material/ChevronLeft";

import { mainListItems, secondaryListItems } from "./templates/listItems";
import { Navbar } from "./templates/navbar";
import { Sidebar } from "./templates/sidebar";
import Badge from "@mui/material/Badge";
import MenuIcon from "@mui/icons-material/Menu";
import NotificationsIcon from "@mui/icons-material/Notifications";

// import { Dashboard as Dashboard_2 } from "./dashboard";
import Dashboard_2 from "./dashboard/Dashboard";

// const { io } = require("socket.io-client");
// const socket = io(process.env.REACT_APP_SERVER_BASE_URL, {
//   transports: ["websocket"],
// });

var machineDumbData = [];
var moldMake = ["ALEX", "TET", "TONY", "MONA"];
var moldMat = ["HIPS", "ABS", "ABS-CLEAR", "SAN"];
for (let index = 0; index < 24; index++) {
  machineDumbData.push({
    machineID: index.toString(),
    monaNumber: "#132" + index.toString(),
    moldID: "QXO43" + index.toString(),
    moldShots: 12 + index,
    failedShots: 2 + (index % 5),
    prodRate: 12 + index,
    material: moldMat[index % 4],
    moldMaker: moldMake[index % 4],
  });
}

export default function Dashboard(props) {
  const [machineData, setMachineData] = useState([]);

  // useEffect(() => {
  //   document.title = "Dashboard";
  // }, [props.title]);

  // useEffect(() => {
  //   socket.on("connect_error", (err) => {
  //     console.log(`connect_error due to ${err.message}`);
  //   });

  //   socket.on("machines", (data) => {
  //     data[0].status = "Online";
  //     console.log(data);
  //     setMachineData(data);
  //   });
  // });
  // i don't want these mesy structre

  return (
    // <DashboardLayout title={""} machineData={machineDumbData}>
    <Routes>
      <Box component="main" sx={{ display: "flex" }}>
        <CssBaseline />
        <Navbar position="absolute" open={open}>
          <Toolbar
            sx={{
              pr: "24px", // keep right padding when drawer closed
            }}
          >
            <IconButton
              edge="start"
              color="inherit"
              aria-label="open drawer"
              onClick={toggleDrawer}
              sx={{
                marginRight: "36px",
                ...(open && { display: "none" }),
              }}
            >
              <MenuIcon />
            </IconButton>
            <Typography
              component="h1"
              variant="h6"
              color="inherit"
              noWrap
              sx={{ flexGrow: 1 }}
            >
              Dashboard
            </Typography>
            <IconButton color="inherit">
              <Badge badgeContent={4} color="secondary">
                <NotificationsIcon />
              </Badge>
            </IconButton>
          </Toolbar>
        </Navbar>
        <Sidebar variant="permanent" open={open}>
          <Toolbar
            sx={{
              display: "flex",
              alignItems: "center",
              justifyContent: "flex-end",
              px: [1],
            }}
          >
            <IconButton onClick={toggleDrawer}>
              <ChevronLeftIcon />
            </IconButton>
          </Toolbar>
          <Divider />
          <List component="nav">
            {mainListItems}
            <Divider sx={{ my: 1 }} />
            {secondaryListItems}
          </List>
        </Sidebar>

        <Route exact path="/d" element={<Dashboard_2 />} />

        <Route
          exact
          path="/"
          element={<MachineList machineData={machineDumbData} />}
        />
        {/* <Route
        path="/machines/:ID"
        element={<MachineInfoPage machineData={machineDumbData} />}
      /> */}
        <Route path="/*" element={<NotFound />} />
      </Box>
    </Routes>
    // </DashboardLayout>
  );
}
